export const INVALIDDATA = "Invalid login or password. Please try again";
export const MINPASSWORDLENGTH = "Password must contain at least 8 characters. Please try again";
export const PASSWORDDONTMATCH = "Passwords don't match. Please try again";
export const EXISTINGEMAIL = "User with this email already exists. Please try again";
export const WRONGEMAIL = "Incorrect email. Please try again"
export const UNKNOWNERROR = "Something went wrong. Please try again later";
export const NOERROR = "";
export const SUCCESS = "Data has been updated successfully!";
